`,paraId:7,tocIndex:2},{value:"\u5728\u793A\u4F8B\u4E2D\uFF0C\u867D\u7136 ",paraId:8,tocIndex:2},{value:"prop1",paraId:8,tocIndex:2},{value:" \u548C ",paraId:8,tocIndex:2},{value:"prop2",paraId:8,tocIndex:2},{value:" \u5E76\u6CA1\u6709\u53D8\u5316\uFF0C\u4F46\u662F\u663E\u7136 MyContext \u91CC\u7684 ",paraId:8,tocIndex:2},{value:"value",paraId:8,tocIndex:2},{value:" \u662F\u4E00\u4E2A\u65B0\u7684 Object \u5BFC\u81F4\u5B50\u7EC4\u4EF6\u5373\u4FBF ",paraId:8,tocIndex:2},{value:"prop1",paraId:8,tocIndex:2},{value:" \u6CA1\u6709\u53D8\u5316\u4E5F\u4F1A\u91CD\u65B0\u6E32\u67D3\u3002\u56E0\u800C\u6211\u4EEC\u9700\u8981\u5BF9 Context ",paraId:8,tocIndex:2},{value:"value",paraId:8,tocIndex:2},{value:" \u8FDB\u884C Memo\uFF1A",paraId:8,tocIndex:2},{value:`// pseudocode
